import style from './EmailForm.module.css'

const EmailForm = () => {
  return (
      <div className={style.emailForm}>
          <div className='leftDarkSide'></div>
          <div className='frameText'></div>
          <div className='emaail'></div>
          <div className='RightDarkSide'></div>
      </div>
  )
}

export default EmailForm
